import { useState, useEffect } from 'react'
import { useSelector, useDispatch } from 'react-redux'
import { Grow, Container, Grid, Typography, Fab } from '@material-ui/core'
import AddIcon from '@material-ui/icons/Add'
import EditIcon from '@material-ui/icons/Edit'
// import SearchIcon from '@material-ui/icon/Search'
import { getEmployees } from '../../actions/employees'
import EmployeeCard from './employeeCard/EmployeeCard'
import NewEmployeeForm from './employeeForm/EmployeeForm'
import useStyles from './styles'

const EmployeesView = () => {
    const employees = useSelector((state) => state.employees)
    const classes = useStyles()

    return (
        <Grid className={classes.center}>


            {/* <NewEmployeeForm /> */}

            <Grow in>
                <Grid container className={classes.grid} spacing={1}>
                    {employees.map((employee) => (
                        <Grid key={employee._id} item>
                            <EmployeeCard employee={employee} />
                        </Grid>
                    ))}
                </Grid>
            </Grow>
            {/* <Fab className={classes.button} color="primary" aria-label="addButton">
                <AddIcon />
            </Fab> */}
            <Fab className={classes.button} color="primary" aria-label="editButton">
                <EditIcon />
            </Fab>

        </Grid>
    )
}

export default EmployeesView
